<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <title>Archived Results - Varendra University</title>
  <link rel="icon" type="image/png" sizes="32x32" href="data:image/png;base64,"/>
  <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.2.0-beta1/dist/css/bootstrap.min.css" rel="stylesheet" />
  <link href="https://aratheunseen.github.io/vu-online-portal/custom.css" rel="stylesheet" />
  <script src="https://aratheunseen.github.io/vu-online-portal/script.js"></script>
  <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.4.0/jquery.min.js"></script>
</head>

<body>
  <div class="container-xl px-4 mt-4">
    <div class="row">
      <div class="col-lg-12 mb-4">
        <div class="card h-100 border-start-lg border-start-primary text-white-50" style="background-color:#ddd;">
          <div class="card-body">
            <div class="small text-muted mb-3 search_panel">Archived Results</div>
            <div class="search_panel">
              <form method="post" action="#">
                <input type="number" onchange="Gets()" name="id" id="id" placeholder="Student ID" pattern="[0-9]{9}"
                  minlength="9" maxlength="9" required autocomplete="on">
                <select id="semester" name="semester" onchange="Gets()">
                  <option value="1st">1st Semester</option>
                  <option value="2nd">2nd Semester</option>
                  <option value="3rd">3rd Semester</option>
                  <option value="4th">4th Semester</option>
                  <option value="5th">5th Semester</option>
                  <option value="6th">6th Semester</option>
                  <option value="7th">7th Semester</option>
                  <option value="8th">8th Semester</option>
                  <option value="9th" selected>9th Semester</option>
                  <option value="10th">10th Semester</option>
                  <option value="11th">11th Semester</option>
                  <option value="12th">12th Semester</option>
                </select>
              </form>
              <button type="submit" class="ibutton">View Transcript</button>
              <div
                style="text-align: center; color: #000; border: 1px solid var(--bs-gray-500); padding:20px;margin:20px 0px;">
                Keyboard Instructions
                <hr>
                <kbd>&larr;</kbd> Previous Student <kbd>&rarr;</kbd> Next Student
                <kbd>&uarr;</kbd> Previous Semester <kbd>&darr;</kbd> Next Semester
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>

    <div class="card card-header-actions mb-4" style="background-color:#ddd;">
      <div class="card-header">
        <div class="container-xl px-4 mt-4">
          <div class="row">
            <div class="right col-lg-3 text-black">
              <img class="mb-5"
                src="data:image/png;base64,"
                height="150px" width="150px" id="image" style="margin: 0 auto;display: flex;border-radius:20px;">
              <p style="border:1px solid #b3b3b3;border-radius:10px;padding:8px 30px 8px;text-align: left; color:#000;" id="showName">Name : ☲☲☲ ☲☲☲☲</p>
              <p style="border:1px solid #b3b3b3;border-radius:10px;padding:8px 30px 8px;text-align: left; color:#000;" id="showID">ID : Loading...</p>
              <p style="border:1px solid #b3b3b3;border-radius:10px;padding:8px 30px 8px;text-align: left; color:#000;" id="showSemester">Semester : Loading...</p>
            </div>
            <embed id="frame" class="mt-5 frame" src="http://202.5.52.152:8081">
          </div>
        </div>
      </div>
    </div>
  </div>
</body>

</html>